minetest.register_privilege("secretskEYEisland_bring",     { description = "Use /secretskEYEisland (playername) on others", }) minetest.register_chatcommand("secretskEYEisland",     {         description = "Teleport to the Sky Islands.",         privs = { interact = true },         func = function(name, param)             if (param ~= "") then                 if (minetest.check_player_privs(name, "secretskEYEisland_bring")) then                     if (minetest.get_player_by_name(param) and name) then                         name =                             param                     else                         minetest.chat_send_player(name, "\"" .. param .. "\" isn't online or doesn't exist.")                         return                     end                 else                     minetest.chat_send_player(name,                         "You don't have permission to run this command (missing privileges: secretskEYEisland_bring).")                     return                 end             end             local player = minetest.get_player_by_name(name)             local pos = vector.new(20000, 20001.5, 20000)             player:setpos(pos)             minetest.chat_send_player(name, "Teleporting to the Sky Islands...")         end     }) 